import {BrowserRouter, Routes, Route} from 'react-router-dom';
import {Box} from '@mui/material';

const App = () => {
  return (
    <BrowserRouter>
        <Box sx={{background: '#000'}}>
            Navbar
            <Routes>
                <Route path="/" exact element={<Feed />} />
            </Routes>
        </Box>
    </BrowserRouter>
  )
}

export default App

/* 
